import React from "react";
import styled from "styled-components";
import apple from "../Images/apple.png";
import google from "../Images/google.png";

// css
const AvailableContainer = styled.div`
  display: flex;
  height: 90vh;
  padding: 3rem 10rem;

  .availableContents {
    width: 45%;
    h3 {
      font-size: 4rem;
    }
    .stores {
      display: flex;
      div {
        background-color: black;
        color: white;
        display: flex;
      }
      img {
        width: 30px;
        height: 40px;
      }
    }
  }
`;

function Available() {
  return (
    <AvailableContainer>
      <div className="availableContents">
        <h3>
          Easier with <br />
          your phone
        </h3>
        <p>Now Gurules is availble on Play Store and App Store. Dowload the application to access tutors more easily and get other attractive promos.</p>

        <div className="stores">
          <div className="apple">
            <img src={apple} alt="apple store" />
            <p>
              Dowload for the <span className="bigText">App Store</span>
            </p>
          </div>
          <div className="google">
            <img src={google} alt="google play store" />
            <p>
              GET IT ON <span className="bigText">Google Play</span>
            </p>
          </div>
        </div>
      </div>
    </AvailableContainer>
  );
}

export default Available;
